import React from 'react';

function createData(id, player, score) {
  return { id, player, score };
}

const rows = [
  createData(1, 'Stone', 1000000),
  createData(2, 'Stone', 1000000),
  createData(3, 'Stone', 1000000),
  createData(4, 'Stone', 1000000),
  createData(5, 'Stone', 1000000),
];

function Leaderboard() {

  return (
    <div className>
        <table>
            <tr>
                <th>#</th>
                <th>Player</th>
                <th>Score</th>
            </tr>
            {rows.map((row) => {
                return(
                    <tr>
                        <td>{row.id}</td>
                        <td>{row.player}</td>
                        <td>{row.score}</td>
                    </tr>
                )
            })}
        </table>
    </div>
  );
}

export default Leaderboard
